import React from "react";

function Square(props) {
    return (
        <div className="square grid-item">
            {
                props.characters.map((char) => {
                    <img src={`${char}.png`} alt={char}/>
                })
            }
            <img src={props.src} alt={props.alt}/>

        </div>
    );
}

export default Square;
